import React from 'react'

export default function Items(props) {
    const item = props.item,
          playerstats = item.playerstats,
          title = item.title
          
    return (
        <section>
            <h3>{title}</h3>
            <table>
            {playerstats.map((stats)=>{})}
            </table>
        </section>
    )
}
